import React from "react"
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge/Badge";
import MailIconHeader from '@material-ui/icons/Mail';
import {makeStyles} from "@material-ui/core";
import MenuItem from "@material-ui/core/MenuItem";

const MessagesIcon = (props) =>{
    const useStyles = makeStyles(theme => ({
        grow: {
            flexGrow: 1,
        },
        sectionDesktop: {
            display: 'none',
            [theme.breakpoints.up('md')]: {
                display: 'flex',
            }
        }
        }))
    const classes = useStyles();
    return <div>

        <div className={classes.grow} title={"zalupa"} />
        <div className={classes.sectionDesktop}>
            <IconButton aria-label= "show 11 new mails" color="inherit">
                <Badge
                    badgeContent={props.NewMessagesCount !== 0 ? props.NewMessagesCount : null }
                    color="secondary">
                    <MailIconHeader />
                </Badge>
            </IconButton>
        </div>

    </div>

}

export default MessagesIcon
